import React from "react";
import './Navbar.css'
import { Link } from "react-router-dom";

const Navbar = () => {
  const navStyle = {
    color: 'white'
  }

  return (
    <div>
      <nav>
        <h3>Logo </h3>
        <ul className="nav-links">
          <Link style={navStyle} to="/about">
            <li>About</li>
          </Link>

          <Link style={navStyle} to='/shop'>
            <li>Shop</li>
          </Link>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
